import React from "react";
import { ExpenseModel } from "../../Model/ExpenseModel";
import ExpenseType from "../../Model/ExpenseType";
import { useState, useEffect} from "react";
import { ExpenseTableItem } from "./ExpenseTableItem";

export const ExpenseTable: React.FC<{expenseList: ExpenseModel[] }> = (props) => {


   console.log(props);
    const expenseList : ExpenseModel[]  = [];

   const deleteExpense : Function = () => {
    return null;
   };


   return (

        <div>


            <table className="color-primary table table-hover" >
                <thead>
                    <tr>
                        <th className="col">#</th>
                        <th className="col">Name</th>
                        <th className="col">Amount</th>
                        <th className="col">Date</th>
                        <th className="col">Type</th>
                    </tr>
                </thead>
                <tbody>


                   {expenseList.map(expense => (
                            <ExpenseTableItem 
                            key = {expense.id}
                            expenseID = {expense.id}
                            expenseName = {expense.name}
                            expenseAmount = {expense.amount}
                            expenseDate = {expense.date}
                            expenseType = {expense.type}
                            deleteExpense = {deleteExpense}
                            />
                        ))}



                </tbody>


            </table>


        </div>

    );

}
